visualeditor-ca-createsource:
Text for the create source link in the tab dropdown, if the page doesn't exist. It's shown next to the message {{msg-mw|vector-view-create}}, so they should be similar (for example, use a similar translation for "Create").

The difference between "Create source" and "Create" is that when "Create source" is for editing the page or the section in wikitext markup language, and "Create" is for editing the page in VisualEditor.

If the page exists, the following link text is used: {{msg-mw|Visualeditor-ca-editsource}}

visualeditor-ca-editsource:
Text for the "Edit source" tab, if the page exists. This is short "Edit the source code of this page" ({{msg-mw|Tooltip-ca-editsource}}).

The difference between "Edit source" and "Edit" ({{msg-mw|edit}}) is that when the Visual Editor is enabled, "Edit source" is for editing the page or the section in wikitext markup language, and "Edit" is for editing the page in VisualEditor. The word "edit" should be used in both messages (with necessary grammar adaptation).

If the page doesn't exist, the following link text is used: {{msg-mw|Visualeditor-ca-createsource}}

Used in:
* {{msg-mw|Visualeditor-beta-warning}}
* {{msg-mw|Visualeditor-wikitext-warning}}
{{Identical|Edit source}}

visualeditor-ca-editsource-section:
Used as link text for "edit source" mode of section edit links. This is short "Edit the source code of this section".

Corresponds to the {{msg-mw|editsection}} message for default mode.
{{Identical|Edit source}}

